import { useState } from "react";
import { useNavigate } from "react-router-dom";
import styled from "styled-components";
import rtn from "../assets/return.png";
export default function CheckoutPage() {
  const [counter, setCounter] = useState(0);
  const [email, setEmail] = useState("");
  const [address, setAddress] = useState("");
  const [card, setCard] = useState("");

  const navigate = useNavigate();
  function returnPage() {
    navigate("/Home");
  }

  return (
    <StyledCheckout>
      <Main>
        <Return src={rtn} onClick={returnPage} />
        <UserInfos>
          <h1> You own *x* </h1>

          <input type="email" placeholder="Type in your email" onChange={(e)=> setEmail() } />
          <input />
          <div> </div>
          <input type="text" placeholder="Type in your address" />
          <input type="number" placeholder="Type in your credit card" />
        </UserInfos>
        <Checkout></Checkout>
      </Main>
    </StyledCheckout>
  );
}

const StyledCheckout = styled.div`
  background-color: black;
  height: 100vh;
  justify-content: center;
  align-items: center;
`;
const Main = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  position: absolute;
`;

const UserInfos = styled.div`
  margin-right: 15px;
  width: 557px;
  height: 439px;
  background: #2d2d2d;
  border-radius: 54px;
  display: flex;
  flex-direction: column;
  align-items: center;
  div {
    width: 10px;
    height: 40px;
  }
  h1 {
    color: white;
    font-size: 58px;
    margin-top: 10px;
    margin-bottom: 40px;
  }
  input {
    width: 236px;
    height: 36px;
    background: #4a4a4a;
    border-radius: 7px;
    margin-bottom: 10px;
  }
`;

const Checkout = styled.div`
  width: 325px;
  height: 439px;
  background: #2d2d2d;
  border-radius: 54px;
`;

const Return = styled.img`
  width: 45px;
  height: 45px;
  position: relative;
  bottom: 290px;
  cursor: pointer;
`;
